import StyleSheet from '../styles/styleSheet';
const background = StyleSheet.background_color;
const colored_txt = StyleSheet.colored_text;
const ComponentStyleSheet = {

    // Styles for footer.js
    footer: {
        background: `${background}`,
    },


    // Styles for navbar.js
    brand: {
        color: `${colored_txt}`,
        fontSize: 'larger',
        fontWeight: 'bolder'
    },
    form: {
        border: `2px solid ${background}`,
        width: '60%',
        borderRadius: '25px',
        padding: '0px 5px'
    }
};

export default ComponentStyleSheet;
